  var htmlContent = "<!-- begin: templates/helpPage.html -->\r\n<div class=\"accordion\" id=\"helpaccordion\">\r\n    <div class=\"accordion-item\">\r\n        <div class=\"accordion-header\" id=\"helphelpheadingOne\">\r\n            <h5 class=\"mb-0\">\r\n                <button class=\"accordion-button\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#collapseOne\" aria-expanded=\"true\" aria-controls=\"collapseOne\">\r\n                    About the New Year Plant Hunt\r\n                </button>\r\n            </h5>\r\n        </div>\r\n\r\n        <div id=\"collapseOne\" class=\"collapse show\" aria-labelledby=\"helpheadingOne\" data-bs-parent=\"#helpaccordion\">\r\n            <div class=\"accordion-body\">\r\n                <p>BSBI's New Year Plant began eleven years ago as an informal activity on social media. Since then the project has grown and is beginning to form a significant archived snapshot of the plants in bloom at the beginning of the year.</p>\r\n                <p>The project is contributing to our understanding of how wild and naturalised plants are responding to changes in autumn and winter weather patterns across Britain and Ireland.</p>\r\n                <p>The 2022 Hunt will run from Saturday 1<sup>st</sup> to Tuesday 4<sup>th</sup> January: head out for a walk of up to 3 hours and see how many wild or naturalised plants (but not garden plants) you can find in bloom.</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"accordion-item\">\r\n        <div class=\"accordion-header\" id=\"helpheadingTwo\">\r\n            <h5 class=\"mb-0\">\r\n                <button class=\"accordion-button collapsed\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#collapseTwo\" aria-expanded=\"false\" aria-controls=\"collapseTwo\">\r\n                    What happens to my records?\r\n                </button>\r\n            </h5>\r\n        </div>\r\n        <div id=\"collapseTwo\" class=\"accordion-collapse collapse\" aria-labelledby=\"helpheadingTwo\" data-bs-parent=\"#helpaccordion\">\r\n            <div class=\"accordion-body\">\r\n                <p>Data from the plant hunt will form part of BSBI's archive of millions plant occurrence records. The Plant Hunt records may be of particular interest as they represent a consistent snap-shot and should help expose long-term changes related to climate change.</p>\r\n                <p>Our record will include the plants you've seen along with any photos that you've sent and the grid-reference for each occurrence. On the project website we show only a summary of the data, so that any confidential details are obscured.</p>\r\n                <p>You can choose whether or not to include your name alongside the occurrence record in our archive. </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"accordion-item\">\r\n        <div class=\"accordion-header\" id=\"helpheadingwhatreport\">\r\n            <h5 class=\"mb-0\">\r\n                <button class=\"accordion-button collapsed\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#collapseWhatReport\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\r\n                    Which plants should I record?\r\n                </button>\r\n            </h5>\r\n        </div>\r\n        <div id=\"collapseWhatReport\" class=\"accordion-collapse collapse\" aria-labelledby=\"helpheadingwhatreport\" data-bs-parent=\"#helpaccordion\">\r\n            <div class=\"accordion-body\">\r\n                <p>\r\n                    Only wild or naturalised plants, not garden plants. They must be in bloom please, plants that only have buds or seed heads don’t count.\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"accordion-item\">\r\n        <div class=\"accordion-header\" id=\"helpphotoid\">\r\n            <h5 class=\"mb-0\">\r\n                <button class=\"accordion-button collapsed\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#collapsePhotoId\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\r\n                    What if I don't know what the plant is?\r\n                </button>\r\n            </h5>\r\n        </div>\r\n        <div id=\"collapsePhotoId\" class=\"accordion-collapse collapse\" aria-labelledby=\"helpphotoid\" data-bs-parent=\"#helpaccordion\">\r\n            <div class=\"accordion-body\">\r\n                <p>If you don't know the name of the plant, you can upload photographs instead, our experts will try to identify it for you.</p>\r\n                <p>Your photos should include a picture of the whole plant and also close-up views of the leaves and flowers. Take photographs from the side (it's harder to identify plants from above)</p>\r\n                <p>Please only choose to name plants that you can identify with confidence and avoid being overprecise unless you are certain (e.g. don't pick a sub-species if you only know the plant well at species level).</p>\r\n                <p>Some common flowers such Dandelion (<i>Taraxacum</i> sp.) can't usually be identified precisely at this time of year, so please record them only at genus level (i.e. as 'Dandelion' / '<i>Taraxacum</i>').</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"accordion-item\">\r\n    <div class=\"accordion-header\" id=\"helpheadingThree\">\r\n        <h5 class=\"mb-0\">\r\n            <button class=\"accordion-button collapsed\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#collapseThree\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\r\n                Locating records (grid-references)\r\n            </button>\r\n        </h5>\r\n    </div>\r\n    <div id=\"collapseThree\" class=\"accordion-collapse collapse\" aria-labelledby=\"helpheadingThree\" data-bs-parent=\"#helpaccordion\">\r\n        <div class=\"accordion-body\">\r\n            <p>If using the recording form on a mobile device in the field then please enable GPS (the button near the location field).</p>\r\n            <p>Otherwise you could type in a OS grid-reference if you know it, or enter a place name or postcode.</p>\r\n            <p>You don't need to set a location for each record, as they will otherwise use the default for the list.</p>\r\n        </div>\r\n    </div>\r\n</div>\r\n    <div class=\"accordion-item\">\r\n        <div class=\"accordion-header\" id=\"helpheadingMultilist\">\r\n            <h5 class=\"mb-0\">\r\n                <button class=\"accordion-button collapsed\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#collapseMultilist\" aria-expanded=\"false\" aria-controls=\"collapseMultilist\">\r\n                    Can I send more than one list.\r\n                </button>\r\n            </h5>\r\n        </div>\r\n        <div id=\"collapseMultilist\" class=\"accordion-collapse collapse\" aria-labelledby=\"helpheadingMultilist\" data-bs-parent=\"#helpaccordion\">\r\n            <div class=\"accordion-body\">\r\n                <p>Yes! We'd welcome multiple lists. If you survey on more than one day or conduct two separate surveys on the same day (e.g. one in morning and then another somewhere else in the afternoon) then send separate lists.</p>\r\n                <p>We prefer lists to be equivalent to the area that someone might cover on foot. If driving some distance between sites, please use a separate list for each location.</p>\r\n                <p>You can start a new list or switch between your lists using the options on the 'Your lists' menu.</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"accordion-item\">\r\n        <div class=\"accordion-header\" id=\"helpheadingSave\">\r\n            <h5 class=\"mb-0\">\r\n                <button class=\"accordion-button collapsed\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#collapseSave\" aria-expanded=\"false\" aria-controls=\"collapseSave\">\r\n                    How do I save my list?\r\n                </button>\r\n            </h5>\r\n        </div>\r\n        <div id=\"collapseSave\" class=\"accordion-collapse collapse\" aria-labelledby=\"helpheadingSave\" data-bs-parent=\"#helpaccordion\">\r\n            <div class=\"accordion-body\">\r\n                <p>The recording form will try to save your records automatically as you go along.</p>\r\n                <p>If your network connection fails then records will be stored locally on your device until you are connected to the internet again. If you have added lots of images then saving may take a few minutes.</p>\r\n                <p>If records are missing from your list on the results page, then please re-open the recording form to allow any unsaved data to be sent. You can also trigger a save using this link (or by choosing ‘save all’ from the lists menu of the recording form).</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"accordion-item\">\r\n        <div class=\"accordion-header\" id=\"helpheadingFour\">\r\n            <h5 class=\"mb-0\">\r\n                <button class=\"accordion-button collapsed\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#collapseFour\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\r\n                    Help and support\r\n                </button>\r\n            </h5>\r\n        </div>\r\n        <div id=\"collapseFour\" class=\"accordion-collapse collapse\" aria-labelledby=\"helpheadingFour\" data-bs-parent=\"#helpaccordion\">\r\n            <div class=\"accordion-body\">\r\n                <p>If you encounter problems, would like to provide feedback about the survey or for more information about the plant hunt, please contact\r\n                    <a href=\"mailto:nyplanthunt@bsbi.org\">nyplanthunt@bsbi.org</a>.\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"accordion-item\">\r\n        <div class=\"accordion-header\" id=\"helpheadingFive\">\r\n            <h5 class=\"mb-0\">\r\n                <button class=\"accordion-button collapsed\" type=\"button\" data-bs-toggle=\"collapse\" data-bs-target=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\r\n                    About us\r\n                </button>\r\n            </h5>\r\n        </div>\r\n        <div id=\"collapseFive\" class=\"accordion-collapse collapse\" aria-labelledby=\"helpheadingFive\" data-bs-parent=\"#helpaccordion\">\r\n            <div class=\"accordion-body\">\r\n                The New Year Plant Hunt is run by the <a href=\"https://bsbi.org/\" target=\"_blank\" title=\"BSBI\">Botanical Society of Britain and Ireland</a>.\r\n                <p>For more information, please contact <a href=\"mailto:nyplanthunt@bsbi.org\">nyplanthunt@bsbi.org</a>.</p>\r\n                <p>Follow us on twitter <a href=\"https://twitter.com/NYPlantHunt\" target=\"_blank\">@NYPlantHunt</a></p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n<!-- end: templates/helpPage.html -->\r\n";

